/*data*/
import producten from "../../../../Data/Collectiepagina/producten";
import productens from "../../../../Data/Collectiepagina/producten";

/*componnets*/
import ProductenCollectie from "./producten/ProductenCollectie";

/*css*/
import "./RightPanel.css";

/*image*/
import buttonIcon from "../../../../img/collectiepagina/add.png";

const RightPanel= () => {

    let keuzeProducten = producten.map(ProductCollectie => {
        return <ProductenCollectie image={ProductCollectie.collectieImage}/>
    })
    return(
        <div className="rightPanel">
            {keuzeProducten}
            <button className="rightpanel__button" onclick="">
                <figure className="rightpanel__button__figure">
                    <img src={buttonIcon} className="rightpanel__button__figure__image"></img>
                </figure>
            </button>
        </div>
    )
}

export default RightPanel;
